  Card,
  Row,
  Col,
  CardTitle,
  CardBody,
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  FormText,
} from "reactstrap";

const Project = () => {
  return (
    <div>
      <CardTitle tag="h6" className="border-bottom text-right">
        Create Project
      </CardTitle>
    </div>
  );
};

export default Project;
